import React from 'react';
import { Link } from 'react-router-dom';
import styles from '../styles/Resume.module.css';

const Resume = () => {
    return (
        <div className={styles.resumeContainer}>
            <h1>Resume</h1>
            <p>Choose your preferred language to download the CV:</p>
            <div className={styles.buttonContainer}>
                <a href="/assets/documents/cv-english.pdf" className={styles.downloadButton} target="_blank" rel="noopener noreferrer">
                    Download CV in English
                </a>
                <a href="/assets/documents/cv-spanish.pdf" className={styles.downloadButton} target="_blank" rel="noopener noreferrer">
                    Download CV in Spanish
                </a>
            </div>
        </div>
    );
};

export default Resume;
